import { BrowserRouter as Router, Switch, Route, Redirect } from 'react-router-dom';
import Home from './Components/Home/Home';

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/" render={() => <Home />} />

        <Redirect to="/" />
      </Switch>
    </Router>
  );
}

export default App;
